                        <div class='tn-atom' field='tn_text_1570537819236'>Мои родители переехали со мной, четырехлетним, в поселок Куеда. Я второй ребенок в семье. 90-е, денег нет, в прихожей нашего деревенского дома растут грибы. За 2 часа до помывки нужно затопить титан, а уголь добыть из кучи во дворе,
                            которая зимой становилась тверже алмаза. После танцев в ДК молодежь дерется на ножах, по субботам по поселку бродят компании с водкой и пивом. Но при этом — полнейшая открытость и кристальная честность всех перед всеми. Было
                            весело. <br></div>
                    </div>
