                        <div class='tn-atom' field='tn_text_1570537819236'>В 15 лет я понял, что в Куеде можно застрять до скончания веков. <br> Закончив 9 классов с отличием, я спросил разрешения у родителей <br> и перевелся в школу ближайшего крупного города — Ижевска. <br><br>Первое время я ходил напуганный,
                            ни с кем не общался и боялся, <br> что из-за угла на меня нападут бандиты. Чтобы избавиться <br> от страха, скованности и стеснения, я записался в школьный КВН. <br><br>И понеслось.<br></div>
