                        <div class='tn-atom' field='tn_text_1570537819236'>Я участвую в сборной школы по КВН. Становлюсь президентом <br> этой самой школы. У меня куча друзей, я популярный. Кажется, что это предел мечтаний для деревенского мальчишки. После <br> 10-го класса я перехожу на экстернат и полностью
                            погружаюсь <br> в КВН. Запускаю второй бизнес: начинаю писать стихи <br> на заказ. Потом начинаю вести мероприятия.<br><br> В карманах зашуршали первые адекватные деньги. <br> Это божественное ощущение, как ни крути. Начались
                            загулы <br> по барам и клубам, за ними потянулись прогулы. Иногда <br> я делал уроки выпившим. Несмотря на всё это, школу <br> я закончил с отличием.<br></div>
