                        data-field-leftunits-value="" data-field-heightunits-value="" data-field-widthunits-value="">
                        <div class='tn-atom' field='tn_text_1570537819236'>Я подал документы в кучу вузов от Питера до Москвы. Но выбрал в итоге Удмуртский государственный университет в Ижевске, направление «Государственное и муниципальное управление» (только что вы прочитали самое скучное предложение
                            на всем сайте).<br><br>Параллельно я попал в команду КВН «Сборная Ижевска», с которой мы гастролировали по всей стране. Институт я заканчивал <br> экстерном: не выдержал пыли аудиторий и монотонных лекций. Попутно вел выпускные
                            и корпоративы, иногда за очень недурные деньги. Зарабатывал 80 000 рублей, что тогда считалось круто даже для Москвы.<br></div>
