                        <div class='tn-atom' field='tn_text_1570537819236'>У отца оставался небольшой цех по производству лимонада, генерирующий едва-едва миллион рублей выручки в год. <br> Вычтите расходы, поделите на работников — получите почти <br> нулевой выхлоп. Я решил попробовать вывести цех на
                            прибыль. <br><br>Было сложно: молодого пацана никто не воспринимал всерьез. <br> Примерно в это время я начал курить. Иногда ночевал перед<br> кабинетами поставщиков. Обрывал телефонные линии <br> в надежде вернуть свои деньги.
                            В итоге цех начал <br> приносить прибыль. <br></div>
