                        <div class='tn-atom' field='tn_text_1570537819236'>Чтобы встряхнуться, 1 января во время утренней пробежки я решил поставить себе новую цель: сделать 2 миллиона за год. Пар вырывался изо рта, вокруг всё как будто вымерло, и тут меня осенило: а почему бы не освещать каждый свой
                            шаг? <br><br>2 января я создал блог во «ВКонтакте», из-за которого и началась вся эта история. Я понял, что с цеха 2 миллиона не получу, и надо открывать что-то еще.<br></div>
