                        data-field-leftunits-value="" data-field-heightunits-value="" data-field-widthunits-value="">
                        <div class='tn-atom' field='tn_text_1570537819236'>Однажды я поехал на деловую встречу в Екатеринбург и познакомился <br> с форматом хостелов. Погуглив минут 10, я понял, что ничего такого <br> в Ижевске нет. Тогда я вместе с другом решил открыть свой хостел.<br><br>Мы были полнейшими
                            профанами. Например, мебель собирали вместе с первыми жильцами. К концу года на меня вышли инвесторы и предложили выкупить 80% доли за 10 миллионов рублей вложений в бизнес. Я согласился. Тогда же я упаковал технологию открытия
                            и начал продавать франшизу за 50 тысяч и 1 рубль через блог. А соединилось с Б. Спойлер: в 2016 году я выкупил эту долю обратно. <br></div>
