                        <div class='tn-atom' field='tn_text_1570537819236'>Вместе со своим партнером Зуфаром Гариповым мы открыли <br> кофейню формата «кофе с собой». Люди, уже зная меня и мою <br> предыдущую франшизу, захотели стать франчайзи и в этом бизнесе. И кофейни начали расти.<br><br>Мы объединили
                            хостелы и кофейни в один бренд Like. Через блог на меня стали выходить ребята с крепкими бизнесами. Они просили принять их в нашу семью и масштабировать их детища. Это было время прорывов. Мы открыли 19 бизнесов, и все они
                            работали в плюс. Мы перевели наш головной офис в Москву. Я тратил столько, сколько никогда не мог и представить. Мы мечтали о 200 бизнесах в 2016 году. Все казалось таким простым и задорным, как в детстве. <br></div>
