                        data-field-leftunits-value="" data-field-heightunits-value="" data-field-widthunits-value="">
                        <div class='tn-atom' field='tn_text_1570537819236'>Мне казалось, что мы уже готовы делиться своим опытом с другими предпринимателями. Так открылся центр поддержки и развития предпринимательства Like Центр.<br><br>Каюсь, я слишком поверил в главную мантру современности <br>«Жить
                            по полной — значит много потреблять». Я забросил <br> компанию, уехал в кругосветку, нанял не того генерального <br> директора. Вдобавок по стране ударил кризис: туристическая <br> сфера обвалилась, похоронив под обломками
                            один из наших<br>проектов, Like Travel. Однажды меня поставили перед <br> фактом: «Аяз, у компании 36 миллионов рублей кассового <br> разрыва. Мы должны просто всем».<br><br>Это был конец.<br></div>
