                        <div class='tn-atom' field='tn_text_1570537819236'>Я понял, что у меня два варианта: <br><br><strong>1. Оформить банкротство физлица, убежать куда подальше, <br> поставив на себе клеймо «слабак». <br> 2. Вернуться в Москву и вывести компанию из крутого пике. </strong><br><br>Я
