                        <div class='tn-atom' field='tn_text_1570537819236'>Мой 2018 год начался с непростого решения — продать долю в сети Coffee Like. Этот бизнес много значил для меня, но дольше оставаться в нем было бы неправильно. Фокус внимания уже давно сместился на другие проекты. Это не позволяло
                            Coffee Like расти и реализовывать свой рыночный потенциал. <br><br> В конце августа мы с покупателями доли подписали обязывающие соглашения по сделке. Актив приобрела группа частных инвесторов, способных привести сеть Coffee
                            Like к новым достижениям. <strong>По итогу сделки я получил 200 млн рублей.</strong> <br><br>В декабре 2018 года мы подписали документы по выкупу Like Hostel Рустамом Аюповым. В августе 2019 года он открыл большой премиум-хостел
                            на 52 этаже башни «Империя»в «Москва-Сити». Кажется, очень неплохо.<br></div>
