                        <div class='tn-atom' field='tn_text_1570537819236'>Like Центр создает новые курсы. Выпускники показывают отличные результаты. Курс «Скорость» аккредитован Министерством экономического развития РФ. <br><br> Пробуем новые форматы: курс «Лекции», бизнес-интенсив «Чит-код», реалити-шоу
                            «Стартаперы». <br><br> Like Центр становится партнером Национальной премии для предпринимателей «Немалый бизнес». Победителей лично поздравляет Президент Российской Федерации В. В. Путин. <br><br>Мы начинаем активно работать
                            над новой идеей, ради которой я продавал Coffee Like — коворкинги. Проект обретает очертания и имя. <br><br> Но на его реализацию требуются дополнительные финансы, и я решаю продать большую часть своей доли в Like Центре. Проект
                            в лице инвестора приобретает сильного стратегического партнёра. Я доволен. <br><br> Закончился мой 3-годовой призыв в Армию. Расслабился. Не понравилось. Подписал ещё один контракт. <br><br></div>
