                                var slidercount = $(sliderID).length;
                                //Записываем ID наших ZeroBlockov       
                                var zeroSlideFull = ["#rec133228864", "#rec133899341", "#rec133899703", "#rec133899943", "#rec133900164", "#rec134010504", "#rec134011716", "#rec134014012", "#rec134015910", "#rec134017566", "#rec134018954", "#rec134019611", "#rec134021087", "#rec134024383"];
                                //Очищаем слайды
                                $(sliderID).empty();
                                //Создаём слайдер... 
                                var i = 0;
                                while (i < slidercount - 2) {
                                    $(zeroSlideFull[i]).appendTo(sliderID + ":eq(" + (i + 1) + ")");
                                    i++;
                                };
                                //Клонируем блоки в нулевой и конечный слайд
                                $(zeroSlideFull[0]).clone().appendTo(sliderID + ":eq(" + (slidercount - 1) + ")");
